import NavbarItem from "./NavBarItem";
import navBar from '../data/navBar.json'
const Home = (props) => {
	const abc = navBar;
	return (
		<div>
			<NavbarItem items={abc}></NavbarItem>
			<h1>Home Page</h1>
		</div>
	);
};

export default Home;
